import React, { useState, useEffect } from 'react'

const NavBar = (props)=> {

   const nextPath = (path) => {
       props.history.push(path);
       // console.log(props)
   }

   return(
       <div>
           <button onClick={() => nextPath("/")}>Log Out</button>
       </div>
   )
}

export default NavBar;
